import React from 'react'
import Popular from '../Componenta/Newsleter/Popular'
import  Navbar from '../Componenta/Section/Navbar'
import {Container } from './style'
const App = () => {
    return (
      <Container>
               <Navbar/>
               <Popular/>
      </Container>
    )
}

export default App
